import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav class="navbar ftco-navbar-light">
      <div class="container-xl">
        <a class="navbar-brand align-items-center" href="/"><span class="">Suzdalenko</span></a>

        <button class="navbar-toggler collapsed" 
          type="button" 
          data-bs-toggle="collapse" 
          data-bs-target="#navbarSupportedContent" 
          id="hamburgerButton" aria-controls="navbarSupportedContent" aria-expanded="true" aria-label="Toggle navigation">
          <span class=""></span>
        </button>

        <div class="collapse navbar-">
          <ul class="navbar-nav ms-auto mb-2 mb-lg-0">
            <li class="nav-item"><Link class="nav-link active" to="/">Inicio</Link></li>
            <li class="nav-item"><Link class="nav-link" to="/Blog">Blog</Link></li>
            asdfasfasdfasdfasdf
          </ul>
        </div>
      </div>

    </nav>
  );
};

export default Navbar;

